import React from 'react';
import { 
  LineChart, 
  Line, 
  XAxis, 
  YAxis, 
  Tooltip, 
  ResponsiveContainer, 
  PieChart, 
  Pie, 
  Cell 
} from 'recharts';
import { 
  Bike as Motorcycle,
  CreditCard, 
  Wallet, 
  Users 
} from 'lucide-react';

// Datos mock
const MONTHLY_DATA = [
  { name: 'Ene', usuarios: 120 },
  { name: 'Feb', usuarios: 150 },
  { name: 'Mar', usuarios: 180 },
  { name: 'Abr', usuarios: 170 },
  { name: 'May', usuarios: 190 },
  { name: 'Jun', usuarios: 210 }
];

const VEHICLE_DATA = [
  { name: 'Motos Particulares', value: 60 },
  { name: 'Motos Mensajería', value: 25 },
  { name: 'Motos Eléctricas', value: 15 }
];

const PIE_COLORS = ['#0088FE', '#00C49F', '#FFBB28'];

const METRICS_CARDS = [
  {
    title: 'Vehículos Estacionados',
    value: '15',
    Icon: Motorcycle,
    colorClass: 'card-blue'
  },
  {
    title: 'Tarifa/Hora',
    value: '$2,000',
    Icon: CreditCard,
    colorClass: 'card-green'
  },
  {
    title: 'Dinero en Caja',
    value: '$458,000',
    Icon: Wallet,
    colorClass: 'card-orange'
  },
  {
    title: 'Abonados',
    value: '60',
    Icon: Users,
    colorClass: 'card-red'
  }
];

// Componente de Tarjeta Métrica
const MetricCard = ({ title, value, Icon, colorClass }) => (
  <div className={`card ${colorClass}`}>
    <div className="card-content">
      <div>
        <p className="card-title">{title}</p>
        <h3 className="card-value">{value}</h3>
      </div>
      <Icon size={32} className="icon" />
    </div>
  </div>
);

// Componente de Gráfico de Línea
const UserLineChart = () => (
  <div className="chart-container">
    <h3 className="chart-title">Usuarios por Mes</h3>
    <div className="chart-wrapper">
      <ResponsiveContainer width="100%" height="100%">
        <LineChart data={MONTHLY_DATA}>
          <XAxis 
            dataKey="name"
            stroke="#6b7280"
            tick={{ fill: '#6b7280' }}
          />
          <YAxis 
            stroke="#6b7280"
            tick={{ fill: '#6b7280' }}
          />
          <Tooltip 
            contentStyle={{
              backgroundColor: 'white',
              border: '1px solid #e5e7eb',
              borderRadius: '6px'
            }}
          />
          <Line 
            type="monotone" 
            dataKey="usuarios" 
            stroke="#3b82f6" 
            strokeWidth={2}
            dot={{
              fill: '#3b82f6',
              stroke: '#3b82f6',
              strokeWidth: 2,
              r: 4
            }}
            activeDot={{
              fill: '#3b82f6',
              stroke: 'white',
              strokeWidth: 2,
              r: 6
            }}
          />
        </LineChart>
      </ResponsiveContainer>
    </div>
  </div>
);

// Componente de Gráfico Circular
const VehiclesPieChart = () => (
  <div className="chart-container">
    <h3 className="chart-title">Tipos de Vehículos</h3>
    <div className="chart-wrapper">
      <ResponsiveContainer width="100%" height="100%">
        <PieChart>
          <Pie
            data={VEHICLE_DATA}
            cx="50%"
            cy="50%"
            outerRadius={100}
            fill="#8884d8"
            dataKey="value"
            label={({name, percent}) => `${name} ${(percent * 100).toFixed(0)}%`}
          >
            {VEHICLE_DATA.map((entry, index) => (
              <Cell 
                key={`cell-${index}`} 
                fill={PIE_COLORS[index % PIE_COLORS.length]} 
              />
            ))}
          </Pie>
          <Tooltip />
        </PieChart>
      </ResponsiveContainer>
    </div>
  </div>
);

// Componente Principal
const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <div className="cards-container">
        {METRICS_CARDS.map((card, index) => (
          <MetricCard
            key={index}
            title={card.title}
            value={card.value}
            Icon={card.Icon}
            colorClass={card.colorClass}
          />
        ))}
      </div>
      <UserLineChart />
      <VehiclesPieChart />
    </div>
  );
};

export default Dashboard;
